import React from "react";
import { Button } from "@material-ui/core";

function Signout({ signOut }) {
  return (
    <div>
      <Button variant="contained" color="primary" onClick={() => signOut()}>
        Sign Out
      </Button>
    </div>
  );
}

export default Signout;
